import styled from "styled-components";

export const SignInContainer = styled.div`
  width: 4330px;
  display: flex;
  flex-direction: column;
`;
export const SignInTitle = styled.span`
  margin: 10px 0;
`;
export const SignInButtons = styled.div`
  display: flex;
  justify-content: space-between;
`;
